#This is a simple brute force algorithm.
#It is easy to see that the maximum number of points that can be scored in a single throw is 60 (triple 20), so we can iterate through all combinations of three throws, and print the first one that adds up to the target score.

#Note that the order of the throws doesn't matter, so we can simplify the code by only checking combinations where the first throw is the smallest, and the second is the second smallest, etc.

#I also include a check to see if the target score is impossible to achieve.

#I use the following functions to get the possible scores for a single throw:

def singles():
    for i in range(1,21):
        yield i

def doubles():
    for i in range(1,21):
        yield 2*i

def triples():
    for i in range(1,21):
        yield 3*i

#I put these in a list to make it easier to iterate through them.

throws = [singles, doubles, triples]

#Now we just need a function that prints out the throws that add up to a given total:

def print_throws(total):
    for i in throws[0]():
        for j in throws[1]():
            for k in throws[2]():
                if i + j + k == total:
                    print("single", i)
                    print("double", j)
                    print("triple", k)
                    return
    print("impossible")

#And finally, we just need to read the target score and print out the throws that add up to it:

n = int(input())
